import React from "react";
import { useNavigate } from "react-router-dom";
import "./welcome.css";
import rocketman from "../assets/img/rocketman.png";
import PersonalInfo from "../PersonalInformation/PersonalInfo";
function Welcome() {
  let navigate = useNavigate();
  const routeChange = () => {
    let path = `newPath`;
    navigate(path);
  };

  return (
    <div className="welcome">
      <h1>Welcome Rocketeer !</h1>
      <button onClick={routeChange}>Start Questionnaire</button>
      <p>Submitted Applications</p>
      <div className="welcome-img">
        <img src={rocketman} alt="" />
      </div>
    </div>
  );
}

export default Welcome;
